// src/pages/Events.js

import React, { useState } from "react";
import Calender from "../components/Calender"; // Ensure this path is correct
import './Events.css'; // This path should work since it's in the same folder

const Events = () => {
  const [date, setDate] = useState(new Date());
  
  const onDateChange = (newDate) => {
    setDate(newDate);
  };

  return (
    <div className="events-page">
      <div className="calendar-container">
        <Calender date={date} onDateChange={onDateChange} />
      </div>
      
      <div className="filters">
        <h2>Filters</h2>
        <div className="filter-card">
          <button>Filter 1</button>
          <button>Filter 2</button>
        </div>
      </div>

      <div className="event-cards">
        <div className="dispEvent">
          <h3>Event 1</h3>
          <p>Description for Event 1</p>
          <button className="enroll-button">Enroll</button>
        </div>
        <div className="dispEvent">
          <h3>Event 2</h3>
          <p>Description for Event 2</p>
          <button className="enroll-button">Enroll</button>
        </div>
        <div className="dispEvent">
          <h3>Event 3</h3>
          <p>Description for Event 3</p>
          <button className="enroll-button">Enroll</button>
        </div>
      </div>
    </div>
  );
};

export default Events;
